#
# Table structure for table 'pages_en1'
#

DROP TABLE IF EXISTS pages_en1;
CREATE TABLE pages_en1 (
  id int(11) unsigned NOT NULL auto_increment,
  parent int(11) unsigned NOT NULL default '0',
  sort varchar(255) binary NOT NULL default '',
  sorttype tinyint(3) unsigned NOT NULL default '0',
  childs smallint(5) unsigned NOT NULL default '0',
  path varchar(255) NOT NULL default '',
  active tinyint(3) unsigned NOT NULL default '1',
  apply tinyint(3) unsigned NOT NULL default '0',
  map tinyint(3) unsigned NOT NULL default '1',
  del tinyint(3) unsigned NOT NULL default '0',
  title varchar(255) NOT NULL default '',
  short text NOT NULL,
  date datetime NOT NULL default '0000-00-00 00:00:00',
  template longtext NOT NULL,
  blocks longtext NOT NULL,
  custom longtext NOT NULL,
  search longtext NOT NULL,
  redirect varchar(64) NOT NULL default '0',
  remark varchar(255) NOT NULL default '',
  owner tinyint(3) unsigned NOT NULL default '0',
  chger tinyint(3) unsigned NOT NULL default '0',
  cdate datetime NOT NULL default '0000-00-00 00:00:00',
  udate timestamp(14) NOT NULL,
  cache text NOT NULL,
  userint int(11) NOT NULL default '0',
  userbit int(11) NOT NULL default '0',
  userstr varchar(255) NOT NULL default '',
  status int(11) NOT NULL default '1',
  uedit0 int(10) unsigned NOT NULL default '1',
  upublish smallint(5) unsigned NOT NULL default '1',
  reason varchar(255) NOT NULL default '',
  uedit1 int(10) unsigned NOT NULL default '0',
  uedit2 int(10) unsigned NOT NULL default '0',
  uedit3 int(10) unsigned NOT NULL default '0',
  tedit0 int(10) unsigned NOT NULL default '1',
  tedit1 int(10) unsigned NOT NULL default '0',
  tedit2 int(10) unsigned NOT NULL default '0',
  tedit3 int(10) unsigned NOT NULL default '0',
  tpublish smallint(5) unsigned NOT NULL default '1',
  lid varchar(16) NOT NULL default 'en_US',
  ver varchar(32) NOT NULL default '1.1',
  vercomm text NOT NULL,
  PRIMARY KEY  (id),
  KEY prnt (parent),
  KEY userint (userint),
  KEY userbit (userbit),
  KEY userstr (userstr),
  KEY path (path),
  KEY sort (sort)
) TYPE=MyISAM;



